import { Link } from 'react-router-dom';

const {sell,rent,partners,nonResi} = {
    sell:"מכירה",
    rent:"השכרה",
    partners:"שותפים",
    nonResi:""
}

const Header = () => {
    return (
        <div>
            {process.env.FLOOPI_GALORP}
     מכירה השכרה דירות שותפים נדל"ן מסחרי
        </div>
    );
}


export default Header;
